import * as THREE from "three"
import React from 'react'
import { useRef, Suspense} from 'react'
import { useThree, useFrame} from "react-three-fiber"
import { useFBX } from '@react-three/drei/useFBX'



const OneFBX = () => {

    const mesh = useRef()
    let fbx = useFBX('/models/1.fbx')
    const { 
      gl,             
      canvas,              
    } = useThree()

    useFrame(() => (mesh.current.rotation.x = mesh.current.rotation.y += 0.01))


      return (
        <mesh
        {...fbx.children[0]}
        ref={mesh}
        position={[0, 0, 0]}
        scale={[0.1,0.1,0.1]}
        name="Object_0"
        rotation={[0, 0, 0]}
      >
            {/* <meshBasicMaterial  attach="material" map={texture}/>   */}
      </mesh>
      )
  }
  const TwoFBX = () => {


    const mesh = useRef()
    let fbx = useFBX('/models/2.fbx')
    const { 
      gl,             
      canvas,              
    } = useThree()

    useFrame(() => (mesh.current.rotation.x = mesh.current.rotation.y += 0.01))


      return (
        <mesh
        onClick={()=>{alert('yo')}}
        {...fbx.children[0]}
        ref={mesh}
        position={[6, 0, 2]}
        scale={[0.1,0.1,0.1]}
        name="Object_0"
        rotation={[0, 0, 0]}
      >
            {/* <meshBasicMaterial  attach="material" map={texture}/>   */}
      </mesh>
      )
  }

  const ThreeFBX = () => {

    const mesh = useRef()
    let fbx = useFBX('/models/3.fbx')
    const { 
      gl,             
      canvas,              
    } = useThree()

     useFrame(() => (mesh.current.rotation.x = mesh.current.rotation.y += 0.01))

      return (
        <mesh
        {...fbx.children[0]}
        ref={mesh}
        position={[12, 0, 4]}
        scale={[0.1,0.1,0.1]}
        name="Object_0"
        rotation={[0, 0, 0]}
      >
            {/* <meshBasicMaterial  attach="material" map={texture}/>   */}
      </mesh>
      )
  }

  const FourFBX = () => {

    const mesh = useRef()
    let fbx = useFBX('/models/4.fbx')
    const { 
      gl,             
      canvas,              
    } = useThree()


    useFrame(() => (mesh.current.rotation.x = mesh.current.rotation.y += 0.01))
      return (
        <mesh
        {...fbx.children[0]}
        ref={mesh}
        position={[0, 0, 6]}
        scale={[0.1,0.1,0.1]}
        name="Object_0"
        rotation={[0, 0, 0]}
      >
            {/* <meshBasicMaterial  attach="material" map={texture}/>   */}
      </mesh>
      )
  }

  const FiveFBX = () => {

    const mesh = useRef()
    let fbx = useFBX('/models/5.fbx')
    const { 
      gl,             
      canvas,              
    } = useThree()

    useFrame(() => (mesh.current.rotation.x = mesh.current.rotation.y += 0.01))

      return (
        <mesh
        {...fbx.children[0]}
        ref={mesh}
        position={[-12, 0, 4]}
        scale={[0.1,0.1,0.1]}
        name="Object_0"
        rotation={[0, 0, 0]}
      >
            {/* <meshBasicMaterial  attach="material" map={texture}/>   */}
      </mesh>
      )
  }

  const SixFBX = () => {

    const mesh = useRef()
    let fbx = useFBX('/models/6.fbx')
    const { 
      gl,             
      canvas,              
    } = useThree()

    useFrame(() => (mesh.current.rotation.x = mesh.current.rotation.y += 0.01))

      return (
        <mesh
        {...fbx.children[0]}
        ref={mesh}
        position={[-6, 0, 2]}
        scale={[0.1,0.1,0.1]}
        name="Object_0"
        rotation={[20, 20, 0]}
      >
            {/* <meshBasicMaterial  attach="material" map={texture}/>   */}
      </mesh>
      )
  }

  const UseFBXScene = () => {
    return (
      <Suspense fallback={null}>
          <OneFBX/>
          <TwoFBX/>
          <ThreeFBX/>
          <FourFBX/>
          <FiveFBX/>
          <SixFBX/>
        </Suspense>
    )
  }

  export default UseFBXScene
